import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Form = () => {

    const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios.get('https://localhost:8000/stockui/')
      .then(response => {
        setPosts(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);
    return (
       <div>{posts}</div>
    )
}

export default Form;
